import "./Expenses.css";
import ExpenseItem from "./ExpenseItems";
import Card from "../UI/Card";

function Expenses(props) {
  const items = props.exp.map((obj, i) => {
    return (
      <ExpenseItem
        key={i}
        title={obj.title}
        amount={obj.amount}
        date={obj.date}
      />
    );
  });
  return <Card className="expenses">{items}</Card>;

